import React, { useState } from 'react'

function Clock() {
    let date = new Date()
    let datetime = {
        year: date.getFullYear(),
        month: date.getMonth(),
        day: date.getDay(),
        hours: date.getHours(),
        minutes: date.getMinutes(),
        seconds: date.getSeconds(),
    }
    const [Ctime, setCtime] = useState(datetime)
    const updateTime = () => {
        let date = new Date()
        let datetime = {
            year: date.getFullYear(),
            month: date.getMonth(),
            day: date.getDay(),
            hours: date.getHours(),
            minutes: date.getMinutes(),
            seconds: date.getSeconds(),
        }
        setCtime(datetime)
    }
    setInterval(updateTime, 1000)
    return (
        <div>
            <strong>{Ctime.year}-{Ctime.month}-{Ctime.day} {Ctime.hours}:{Ctime.minutes}:{Ctime.seconds}</strong>
            asd{new Date()}
        </div>
    )
}

export default Clock
